import CdnResolverImage from "@/Components/CdnResolverImage.vue";
export default {
  data() {
    return {
      killLogList: [],
      lastId: 0,
      maxItemsCount: 5
    };
  },
  components: {
    CdnResolverImage
  },
  methods: {
    addKillLogItem(item) {
      item.id = this.lastId++;
      this.killLogList.unshift(item);
      if (this.killLogList.length > this.maxItemsCount) {
        this.killLogList.pop();
      }
    },
    onClear() {
      this.killLogList = [];
    }
  },
  mounted() {
    this.$onClient("W:KillLog:AddItem", this.addKillLogItem);
    this.$onClient("W:KillLog:Clear", this.onClear);
    this.$callClient("C:KillLog:Ready");
  }
};
